import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import './Login.css';

function Login(props){

    return(
        <div>
            <form className="contact-form row">
            <div className="form-field col-lg-6 formBox">
                <input id="userName" className="input-text js-input" type="text" required/>
                <label className="label" for="">UserName</label>
                <input id="userPassword" className="input-text js-input" type="password" required />
                <label className="label" for="">Password</label>

            </div>
            </form>

        </div>

    );
}
export default Login;
